import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a modal: Click on a product card to open the product detail modal
    // Wait for a product card to be present
    await page.waitForSelector('.product-card', { timeout: 5000 });
    // Click the first product card
    const productCards = await page.$$('.product-card');
    if (productCards.length === 0) {
      throw new Error('No product card found to open modal.');
    }
    await productCards[0].click();

    // Wait for the modal to appear (modal has id="productModal" and style.display = 'block')
    await page.waitForSelector('#productModal', { timeout: 5000 });
    // Wait for modal to be visible
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display !== 'none';
    }, { timeout: 5000 });

    // Take screenshot with modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press Escape to close the modal
    await page.keyboard.press('Escape');

    // Wait for the modal to be hidden
    await page.waitForFunction(() => {
      const modal = document.getElementById('productModal');
      return modal && window.getComputedStyle(modal).display === 'none';
    }, { timeout: 5000 });

    // Take screenshot after modal is closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract data to verify modal is closed
    const modalDisplay = await page.evaluate(() => {
      const modal = document.getElementById('productModal');
      return modal ? window.getComputedStyle(modal).display : null;
    });

    return {
      success: true,
      action: "Opened the product modal and closed it using the Escape key",
      extractedData: {
        modalDisplayAfterEscape: modalDisplay
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
